import React from 'react';

export const List = ({ todoItems }) => {
	const handleClick = () => {
		console.log("please delete me!");
	};

	const list = todoItems.map((element, index) => 
		<li key={index}>
			{element} 
			<button onClick={handleClick}>Delete</button>
		</li>);

	return <ul>{list}</ul>;
};
